import React from 'react';

const Photography = () => {
    return (
        <section id="photography" className="section">
            <div className="container">
                <h2>Photography</h2>
                <div className="photo-gallery">
                    {/* Photos will be added here */}
                </div>
            </div>
        </section>
    );
};

export default Photography;
